function calculate(){let e=parseInt(document.getElementById("calculator-rent-curr_deposit").value),t=parseFloat(document.getElementById("calculator-rent-conversion_rate").value)/100,a=parseInt(document.getElementById("calculator-rent-new_deposit").value),n=e-a,l=0,r=!0;(isNaN(n)||isNaN(e)||isNaN(t)||isNaN(a))&&(alert("데이터를 입력해주세요."),r=!1),r&&(l=Math.round(n*t/12*100)/100,document.getElementById("result1").innerText=`${l}`)}